  false,\n\t\"url\": null,\n\t\"notes\": \"Final report on a project to develop normal
  reference range values for minerals in elk across several habitats and management
  scenarios within Region 6, including Fort Niobrara National Wildlife Refuge. These
  baseline data will provide a foundation for future comparison with environmental
  and population variables such as forage nutrition and mineral values, population
  productivity, or body condition that will inform and help guide future management
  of bison and elk on FWS Refuges.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
